    <div className="board-row">
    <Square value="4"/>
    <Square value="5"/>
    <Square value="6"/>
    </div>
    <div className="board-row">
    <Square value="7"/>
    <Square value="8"/>
    <Square value="9"/>
    </div>
    </>
  );
}

function Square() {
  return (
    <button className="square" onClick={handleClick}>
      {value}
    </button>
  );

  const [value, setValue] = useState(null);

  function handleClick() {
    setValue("X");
  }
}
